    public class FrmTest_TreeView_ViewModel : System.Windows.DependencyObject, INotifyPropertyChanged
    {
        #region INotifyPropertyChanged成员

        public event PropertyChangedEventHandler PropertyChanged;

        protected virtual void OnPropertyChanged(string propertyName = "")
        {
            this.PropertyChanged?.Invoke(this, new PropertyChangedEventArgs(propertyName));
        }

        #endregion

        private List<Location> _TreeViewAdv_ItemsSourceOverride;
        public List<Location> TreeViewAdv_ItemsSourceOverride
        {
            get { return _TreeViewAdv_ItemsSourceOverride; }
            set
            {
                _TreeViewAdv_ItemsSourceOverride = value;
                this.OnPropertyChanged(nameof(TreeViewAdv_ItemsSourceOverride));
            }
        }

        private System.Collections.IList _TreeViewAdv_SelectedItems;
        public System.Collections.IList TreeViewAdv_SelectedItems
        {
            get { return _TreeViewAdv_SelectedItems; }
            set
            {
                _TreeViewAdv_SelectedItems = value;
                this.OnPropertyChanged(nameof(TreeViewAdv_SelectedItems));
            }
        }


        private System.Collections.IList _TreeViewAdv_SelectedItemsWithNull;
        public System.Collections.IList TreeViewAdv_SelectedItemsWithNull
        {
            get { return _TreeViewAdv_SelectedItemsWithNull; }
            set
            {
                _TreeViewAdv_SelectedItemsWithNull = value;
                this.OnPropertyChanged(nameof(TreeViewAdv_SelectedItemsWithNull));
            }
        }


        private Window _mOwner;
        public Window mOwner
        {
            get 
            {
                // TODO 获取当前窗口
                if (_mOwner == null)
                {
                    _mOwner = Application.Current.Windows
                                         .OfType<Window>()
                                         .Where(i => i.IsActive == true)
                                         // .Where(i => i.DataContext == this)
                                         .First();
                }

                return _mOwner; 
            }
        }

        public FrmTest_TreeView_ViewModel()
        {
            initCMD();
            initTreeViewData();
        }

        void initTreeViewData()
        {
            var list = Location.GetLocaionList();

            TreeViewAdv_ItemsSourceOverride = list;

            var s0 = list.FirstOrDefault(i => i.Name == "荔湾区");
            var s1 = list.FirstOrDefault(i => i.Name == "阳西县");

            // TreeViewAdv_SelectedItems = new ObservableCollection<Location>() { s0, s1 };
            TreeViewAdv_SelectedItemsWithNull = new ObservableCollection<Location>() { s0, s1 };
        }

        void initCMD()
        {
            this.CMD_ShowViewModelData = new Command(ShowViewModelData);

            this.CMD_TreeViewAdv_CheckAll = new Command(TreeViewAdv_CheckAll);
            this.CMD_TreeViewAdv_ResverseCheckAll = new Command(TreeViewAdv_ResverseCheckAll);
        }

        public Command CMD_ShowViewModelData { get; private set; }
        void ShowViewModelData()
        {   
            WPFControls.MessageBox.ShowInformationDialog(mOwner, Util.JsonUtils.SerializeObjectWithFormatted(this.TreeViewAdv_SelectedItems));
            WPFControls.MessageBox.ShowInformationDialog(mOwner, Util.JsonUtils.SerializeObjectWithFormatted(this.TreeViewAdv_SelectedItemsWithNull));
        }


        public Command CMD_TreeViewAdv_CheckAll { get; private set; }
        void TreeViewAdv_CheckAll(object objTreeViewAdv)
        {
            if (objTreeViewAdv is Client.Components.TreeViewAdv target)
            {
                mOwner.Cursor = System.Windows.Input.Cursors.Wait; // 在控件内编写没有效果
                target.CheckAll();
                mOwner.Cursor = System.Windows.Input.Cursors.Arrow;
            }
        }

        public Command CMD_TreeViewAdv_ResverseCheckAll { get; private set; }
        void TreeViewAdv_ResverseCheckAll(object objTreeViewAdv)
        {
            if (objTreeViewAdv is Client.Components.TreeViewAdv target)
            {
                mOwner.Cursor = System.Windows.Input.Cursors.Wait; // 在控件内编写没有效果
                target.ResverseCheckAll();
                mOwner.Cursor = System.Windows.Input.Cursors.Arrow;
            }
        }

